 <div id=content1 class=boxContent>
 <p class=contentTitle>SAIBA COMO USAR</p>
 <p id=conheca_saibaMais>Utilizar o Internet Banking CAIXA é rápido e prático!<a class=knowMorelink> Clique aqui </a>para entender como funciona. 
<div style=margin-top:-300px;padding-right:20px id=novosaiba class="knowMore | knowMorelogin ui-draggable sf-hidden">
 
 </div>
<p></p>
 </div>
 <div id=content2 class=boxContent>
 <p class=contentTitle>ACESSIBILIDADE</p>
 <p id=conheca_acessibilidade>A CAIXA pratica a cidadania também no Internet Banking CAIXA, onde os clientes com deficiência e/ou limitações visuais encontram uma plataforma adaptada à acessibilidade.<a class=knowMorelink> Conheça</a>.
<div style=margin-top:-300px;padding-right:20px id=nacess class="knowMore | knowMorelogin ui-draggable sf-hidden">
 
 </div><p></p>
 </div>
 <div id=content3 class=boxContent>
 <p class=contentTitle>CADASTRO DE COMPUTADORES</p>
 <p id=conheca_cad_computadores>Para efetuar transações financeiras a partir do internet banking você precisa cadastrar o dispositivo a ser utilizado. <br><br>
Chamamos de dispositivo todo equipamento utilizado para acesso ao Internet Banking Caixa como computador, tablet e smartphone. 
Ao selecionar algum serviço que exija o uso da assinatura eletrônica (por exemplo pagamento ou transferência), você será direcionado para o cadastramento do dispositivo que está utilizando. Você deverá escolher um apelido para o equipamento e o tempo que deseja mantê-lo cadastrado.<br><br>
Para a sua segurança, o dispositivo será validado apenas após ativação via SMS, ou em um outro dispositivo já cadastrado, ou em uma agência . <br><br>
<a class=knowMorelink>Clique aqui </a>e saiba mais sobre cadastramento do seu dispositivo.<div style=margin-top:-400px;padding-right:20px id=novocomp class="knowMore | knowMorelogin ui-draggable sf-hidden">
 
 </div>
<p></p>
 </div>
 <div id=content4 class=boxContent>
 <p class=contentTitle>SENHA E USUÁRIO</p>
 <p id=conheca_usu_senha>Para movimentar sua conta pelo Internet Banking será necessário criar um usuário, uma senha internet e uma assinatura eletrônica. <br><br>
Caso este seja seu primeiro acesso, ou tenha esquecido, ou bloqueado seu usuário ou senha internet, será necessário um novo cadastro clicando no botão CADASTRAR.<br><br>
Caso você tenha bloqueado sua assinatura eletrônica, você pode desbloqueá-la em um de nossos Caixas Eletrônicos, na opção Outros Serviços &gt; Outros Serviços &gt; Senhas e validações de acesso &gt; Desbloqueio de assinatura eletrônica, ou em sua agência. <br><br>
Caso você tenha esquecido sua assinatura eletrônica, solicite uma nova em sua agência. <br><br>
<a class=knowMorelink>Clique aqui </a>para mais detalhes sobre usuário, senha internet e assinatura eletrônica.
<div style=margin-top:-400px;padding-right:20px id=novasenha class="knowMore | knowMorelogin ui-draggable sf-hidden">
 
 </div>
<p></p>
 </div>
 <div id=content5 class=boxContent>
 <p class=contentTitle>PERGUNTAS FREQUENTES</p>
 <p id=conheca_perguntas_freq>Caso tenha alguma dúvida sobre algum procedimento, <a href=http://www.caixa.gov.br/atendimento/internet-banking/perguntas-frequentes/Paginas/default.aspx target=blank>clique aqui</a> para acesso as dúvidas mais freqüentes. 
</p>
